using Microsoft.Xna.Framework;
using Terraria;
using static Terraria.ModLoader.ModContent;
using ExoriumMod.Content.Walls.StructureWalls.FallenTowerWalls;
using ExoriumMod.Content.Tiles.StructureTiles.FallenTowerTiles;
using ExoriumMod.Content.Tiles;
using Terraria.ID;
using Terraria.WorldBuilding;

namespace ExoriumMod.Core.WorldGeneration.Structures
{
    public static partial class ExoriumStructures
    {
        private const int SIDE_GAP_WIDTH = 20;

        public static void FallenTower()
        {
            int attempts = 0;
            bool success = false;
            int i = 0;
            int j = 0;
            while (!success)
            {
                if (attempts > 10000)
                {
                    success = true;
                    return;
                }
                i = Main.maxTilesX / 2 + (WorldGen.genRand.Next(Main.maxTilesX / 6, Main.maxTilesX / 3) * (WorldGen.genRand.NextBool() ? -1 : 1));
                j = Main.maxTilesY - 200;

                ExoriumWorld.FallenTowerRect.X = i * 16;
                ExoriumWorld.FallenTowerRect.Y = j * 16;
                ExoriumWorld.FallenTowerRect.Width = _fallenTowerShape.GetLength(1) * 16;
                ExoriumWorld.FallenTowerRect.Height = _fallenTowerShape.GetLength(0) * 16;

                //Check for other protected structures
                if (GenVars.structures.CanPlace(new Rectangle(i, j, _fallenTowerShape.GetLength(1), _fallenTowerShape.GetLength(0)), 50))
                    success = true;
                else
                    attempts++;
            }
            for (int y = 0; y < _fallenTowerShape.GetLength(0); y++)
            {
                for (int x = 0; x < _fallenTowerShape.GetLength(1); x++)
                {
                    int k = i + x;
                    int l = j + y;
                    if (!WorldGen.InWorld(k, l))
                        break;
                    Tile tile = Framing.GetTileSafely(k, l);
                    tile.LiquidAmount = 0;
                    switch (_fallenTowerShape[y, x])
                    {
                        case 0:
                            tile.HasTile = false;
                            WorldGen.KillTile(k, l);
                            tile.WallType = (ushort)WallType<CharredObsidianWall>();
                            break;
                        case 1:
                            tile.HasTile = false;
                            WorldGen.KillTile(k, l);
                            WorldGen.PlaceTile(k, l, TileType<CharredObsidianTile>());
                            tile.Slope = 0;
                            break;
                        case 2:
                            tile.HasTile = false;
                            WorldGen.KillTile(k, l);
                            WorldGen.PlaceTile(k, l, TileType<CharredObsidianPlatformTile>());
                            tile.WallType = (ushort)WallType<CharredObsidianWall>();
                            break;
                        case 3:
                            tile.HasTile = false;
                            WorldGen.KillTile(k, l);
                            tile.WallType = (ushort)WallType<CharredObsidianWall>();
                            WorldGen.PlaceTile(k, l, TileID.Torches);
                            break;
                        case 4:
                            tile.HasTile = false;
                            WorldGen.KillTile(k, l);
                            WorldGen.PlaceTile(k, l, TileType<CharredObsidianTile>());
                            tile.Slope = SlopeType.SlopeDownRight;
                            break;
                        case 5:
                            tile.HasTile = false;
                            WorldGen.KillTile(k, l);
                            WorldGen.PlaceTile(k, l, TileType<CharredObsidianTile>());
                            tile.Slope = SlopeType.SlopeDownLeft;
                            break;
                        default:
                            break;
                    }
                }
            }
            for (int a = 0; a < _fallenTowerShape.GetLength(1) - (SIDE_GAP_WIDTH * 2); a++)
            {
                for (int b = 0; b < 200 - _fallenTowerShape.GetLength(0); b++)
                {
                    int k = i + SIDE_GAP_WIDTH + a;
                    int l = j + _fallenTowerShape.GetLength(0) + b;
                    if (WorldGen.InWorld(k, l))
                    {
                        Tile tile = Framing.GetTileSafely(k, l);
                        WorldGen.KillTile(k, l);
                        if (a != 0 && a != _fallenTowerShape.GetLength(1) - (SIDE_GAP_WIDTH * 2) - 1) // no wall on the far sides so they don't bleed out
                            tile.WallType = (ushort)WallType<CharredObsidianWall>();
                        WorldGen.PlaceTile(k, l, TileType<CharredObsidianTile>());
                    }
                }
            }

            //Protect from other generation
            GenVars.structures.AddStructure(new Rectangle(i, j, _fallenTowerShape.GetLength(1), _fallenTowerShape.GetLength(0)), 50);
        }

